/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_annulla_biglietto` AFTER UPDATE ON `biglietto` FOR EACH ROW /* dopo una modifica in tabella biglietto, controlla se il 
record con vecchio stato biglietto diverso da annullato ha 
ora come nuovo valore annullato, se è cosi allora richiama 
la tabella biglietto tratta e cambia lo stato biglietto di 
tutti i biglietti tratta referenziati in annullato*/
BEGIN
