/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_check_posti_disponibili` BEFORE INSERT ON `biglietto_tratta` FOR EACH ROW BEGIN
   /*questo trigger serve a segnalare a sistema che se il nuovo record da inserire ha come valore nel campo occupa posto 1, 
   e allo stesso la variabile definita tramite i valori del record referenziato nella tabella corsa, ha valore uguale o 
   minore di zero, allora ferma l'operazione e riporta un allarme*/
   DECLARE posti_liberi INT; /* crea variabile */

    SELECT (posti_totali - posti_occupati)
    INTO posti_liberi
    FROM corsa
    WHERE id_corsa = NEW.id_corsa
    FOR UPDATE;

    IF NEW.occupa_posto = 1 AND posti_liberi <= 0 THEN /* se non ci sono più posti liberi */
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Posti esauriti per la corsa selezionata';
    END IF;
END */;;
DELIMITER ;
