/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_prenota_posto` AFTER INSERT ON `biglietto_tratta` FOR EACH ROW BEGIN
   /*Questo trigger controlla se il nuovo record inserito nella tabella  biglietto tratta ha come valore nel campo
   occupa posto 1 e se lo stato tratta è prenotato, se entrambe le considerazioni sono vere richiama la tabella corsa 
   e il valore del campo posti occupati di 1 dove l'id corsa equivale all'id corsa del nuovo record inserito nella 
   tabella biglietto tratta */
   IF NEW.occupa_posto = 1 AND NEW.stato_tratta = 'prenotata' THEN
        UPDATE corsa
        SET posti_occupati = posti_occupati + 1
        WHERE id_corsa = NEW.id_corsa;
    END IF;
END */;;
DELIMITER ;
