/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_update_posti_tratta` AFTER UPDATE ON `biglietto_tratta` FOR EACH ROW BEGIN
/*questo trigger parte dopo ogni modifica ai valori della tabella biglietto tratta, 
se un record ha il valore stato tratta modificato da prenotata a annullata allora 
controlla se il valore correlato nel campo occupa posto equivale a 1, se è cosi, 
allora richiama la tabella corsa e modifica il campo posti occupati del record 
referenziato con -1 */
    IF OLD.stato_tratta = 'prenotata'
       AND NEW.stato_tratta = 'annullata'
       AND OLD.occupa_posto = 1 THEN

        UPDATE corsa
        SET posti_occupati = posti_occupati - 1
        WHERE id_corsa = NEW.id_corsa;
    END IF;
END */;;
DELIMITER ;
