CREATE DEFINER=`root`@`localhost` PROCEDURE `genera_corse_giornaliere`()
BEGIN /* indica l'inizio effettivo della procedura*/
    DECLARE finito INT DEFAULT 0; /* crea una variabile sentinella per capire quando il cursore deve uscire dal ciclo */

    DECLARE v_id_tratta INT; /* creo tutte le variabili con il prefisso v per variabile in snake case */
    DECLARE v_id_linea INT;
    DECLARE v_distanza INT;
    DECLARE v_velocita INT;
    DECLARE v_sosta INT; /* le corse urbane sostano 2 minuti mentre le extraurbane 5 */
    DECLARE v_posti_totali INT;
    DECLARE v_tipo_linea VARCHAR(20);
    DECLARE v_orario TIME; /* uso tipo dato time per memorizzare un orario in formato ore:minuti:secondi */
    DECLARE v_frequenza INT;
    DECLARE v_minuti_volo INT;

    DECLARE cur_tratte CURSOR FOR /* definisce un puntatore per scorrere sulle linee e recuperare i valori, da indicazioni di best practice in MySQL */
        SELECT
           t.id_tratta,
            l.id_linea,
            t.distanza_km,
            tl.velocita_kmh,
            tl.tempo_sosta_min,
			tl.nome,
            tl.capacita
		FROM tratta t
        JOIN linea l ON l.id_linea = t.id_linea
        JOIN tipo_linea tl ON tl.id_tipo_linea = l.id_tipo_linea; /* facciamo un inner join per facilitare il recupero dei valori */

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET finito = 1; /* quando il cursore non trova dati, imposta la variabile sentinella su valore 1 */

    OPEN cur_tratte; /* avvia il cursore */

    loop_tratte: LOOP /* il cursore carica una tratta dopo l'altra */
        FETCH cur_tratte INTO /* i valori recuperati vengono immessi in queste variabili */
            v_id_tratta,
            v_id_linea,
            v_distanza,
            v_velocita,
            v_sosta,
            v_tipo_linea,
            v_posti_totali;

        IF finito = 1 THEN /* quando la sentinella diventa 1 il cursore esce dal ciclo */
            LEAVE loop_tratte;
        END IF;

        SET v_minuti_volo = CEIL((v_distanza / v_velocita) * 60); /* usiamo il tipo dato CEIL per arrotondare il valore numerico per eccesso */
        SET v_orario = '00:00:00';

         WHILE v_orario < '23:59:00' DO

            /* Frequenze in base alla fascia oraria */
            IF v_orario BETWEEN '07:00:00' AND '10:00:00'
               OR v_orario BETWEEN '12:00:00' AND '14:00:00'
               OR v_orario BETWEEN '17:00:00' AND '20:00:00' THEN

                SET v_frequenza =
