                id_tratta,
                orario_partenza,
                orario_arrivo,
                posti_totali
            )
            VALUES (
                CONCAT('C-', v_id_tratta, '-', v_orario),
                v_id_linea,
                v_id_tratta,
                v_orario,
                ADDTIME(
                    v_orario,
                    SEC_TO_TIME((v_minuti_volo + v_sosta) * 60)
                ),
                v_posti_totali
            );

            /* Avanzamento orario */
            SET v_orario = ADDTIME(
                v_orario,
                SEC_TO_TIME(v_frequenza * 60)
            );

        END WHILE;

    END LOOP;

    CLOSE cur_tratte;
END ;;
